style.css:
@-moz-document domain("ipinfo.io") {
/* https://ipinfo.io/countries/us */

body {
    background: #212529;
}

.text-charcoal-blue-primary {
    color: #fff;
}

.border, .border-t, .border-green-01, .border-gray-100 {
    border-color: #3d4349;
}

.bg-white {
    background: #212529;
}

.bg-charcoal-blue-03 {
    background: #212529;
}

.even\:bg-charcoal-blue-03:nth-child(2n) {
    background: #2a2f33;
}

.bg-green-01 {
    background: #2b3035;
}

.text-charcoal-blue-80 {
    color: #d3d3d3;
}

/* https://ipinfo.io/$ip_address */

.general-announcement-banner {
    background: #2b3035;
    color: #d3d3d3;
}

.card {
    background: #212529;
}

.main-content .card {
    color: #fff;
}

.main-content .design-new .info-table .title {
    color: #fff;
}

.table {
    color: #fff;
}

.table-striped tbody tr:nth-of-type(odd) {
    background: #2a2f33;
}

.text-popover {
    color: #fff;
}

.main-content .design-new .card.card-details {
    border: 1px solid #3d4349;
}

.main-content .design-new .ds21-vertical-menu {
    border: 1px solid #3d4349;
}

.main-content .design-new .ds21-vertical-menu li a {
    color: #fff;
}

.main-content .design-new .ds21-vertical-menu li a:hover {
    background: #373c40;
}

header .navbar {
    background: #212529;
}

header .navbar .navbar-collapse .navbar-nav .nav-item a:not(.btn) {
    color: #fff;
}

header {
    border-bottom: 1px solid #3d4349;
}
}
